INSERT INTO `workplace` (`id`, `name`, `country`, `description`, `type`) VALUES
(2, 'Gjvik University College (GUC)', 'Norway', 'GUC is a Norwegian university college with an international perspective. Currently, there are 30 countries represented among our staff.\r\n\r\nGUC was established as a result of the reorganisation of Norwegian higher education in 1994 when the Gjvik College of Engineering and the College of Nursing in Oppland were merged into a single college.', 0),
(3, 'Lillehammer University College', 'Norway', 'Lillehammer University College (LUC) is located in beautiful surroundings in central eastern Norway. The institution has a long tradition as education provider and is part of the Norwegian public higher education system. LUC is situated just outside the city of Lillehammer and has approximately 4200 students and an academic and administrative staff of 330 employees. All on one campus.', 0),
(4, 'The Norwegian Colour and Visual Computing Laboratory', 'Norway', 'A research group within the  Media Technology Laboratory  and  Faculty of Computer Science and Media Technology  at  Gjvik University College . It was founded in spring 2001 to serve the rising needs for colour management solutions in the graphic arts industry.', 1),
(5, 'Other', 'Other', '', 1);
